ing categories.", "type": "array" } }, "description": "Representative value of a categorical feature.", "type": "object" }, "SetIamPolicyRequest": { "id": "SetIamPolicyRequest", "properties": { "updateMask": { "description": "OPTIONAL: A FieldMask specifying which fields of the policy to modify. Only the fields in the mask will be modified. If no mask is provided, the following default mask is used: `paths: \"bindings, etag\"`", "format": "google-fieldmask", "type": "string" }, "policy": { "$ref": "Policy", "description": "REQUIRED: The complete policy to be applied to the `resource`. The size of the policy is limited to a few 10s of KB. An empty policy is a valid policy but certain Google Cloud services (such as Projects) might reject them." } }, "description": "Request message for `SetIamPolicy` method.", "type": "object" }, "JobStatistics5": { "properties": { "copied_rows": { "description": "[Output-only] Number of rows copied to the destination table.", "type": "string", "format": "int64" }, "copied_logical_bytes": { "type": "string", "description": "[Output-only] Number of logical bytes copied to the destination table.", "format": "int64" } }, "type": "object", "id": "JobStatistics5" }, "Binding": { "type": "object", "id": "Binding", "description": "Associates `members`, or principals, with a `role`.", "properties": { "members": { "items": { "type": "string" }, "type": "array", "description": "Specifies the principals requesting access for a Google Cloud resource. `members` can have the following values: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh `allUsers`: A special identifier that represents anyone who is on the internet; with or without a Google account. LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh `allAuthenticatedUsers`