n in the datasetId field. When creating a new dataset, leave this field blank, and instead specify the datasetId field.", "type": "string" }, "maxTimeTravelHours": { "format": "int64", "description": "[Optional] Number of hours for the max time travel for all tables in the dataset.", "type": "string" }, "location": { "type": "string", "description": "The geographic location where the dataset should reside. The default value is US. See details at https://cloud.google.com/bigquery/docs/locations." }, "description": { "description": "[Optional] A user-friendly description of the dataset.", "type": "string" }, "tags": { "items": { "properties": { "tagValue": { "type": "string", "description": "[Required] Friendly short name of the tag value, e.g. \"production\"." }, "tagKey": { "type": "string", "description": "[Required] The namespaced friendly name of the tag key, e.g. \"12345/environment\" where 12345 is org id." } }, "type": "object" }, "description": "[Optional]The tags associated with this dataset. Tag keys are globally unique.", "type": "array" }, "selfLink": { "description": "[Output-only] A URL that can be used to access the resource again. You can use this URL in Get or Update requests to the resource.", "type": "string" }, "lastModifiedTime": { "format": "int64", "description": "[Output-only] The date when this dataset or any of its tables was last modified, in milliseconds since the epoch.", "type": "string" }, "defaultTableExpirationMs": { "description": "[Optional] The default lifetime of all tables in the dataset, in milliseconds. The minimum value is 3600000 milliseconds (one hour). Once this property is set, all newly-created tables in the dataset will have an expirationTime property set to the creation time plus the value in this property, and changing the value will only affect new tables, not existing ones. When the expirationTime for a given table is reached, that table will be deleted automatically. If a table's expirationTime is modified or remove