umber of true samples predicted as false." }, "falsePositives": { "type": "string", "description": "Number of false samples predicted as true.", "format": "int64" }, "recall": { "description": "The fraction of actual positive labels that were given a positive prediction.", "type": "number", "format": "double" }, "truePositives": { "format": "int64", "description": "Number of true samples predicted as true.", "type": "string" }, "f1Score": { "type": "number", "description": "The equally weighted average of recall and precision.", "format": "double" }, "positiveClassThreshold": { "description": "Threshold value used when computing each of the following metric.", "type": "number", "format": "double" }, "precision": { "description": "The fraction of actual positive predictions that had positive actual labels.", "type": "number", "format": "double" } }, "description": "Confusion matrix for binary classification models.", "type": "object" }, "SnapshotDefinition": { "id": "SnapshotDefinition", "properties": { "baseTableReference": { "$ref": "TableReference", "description": "[Required] Reference describing the ID of the table that was snapshot." }, "snapshotTime": { "description": "[Required] The time at which the base table was snapshot. This value is reported in the JSON response using RFC3339 format.", "format": "date-time", "type": "string" } }, "type": "object" }, "BigtableColumn": { "properties": { "qualifierEncoded": { "format": "byte", "description": "[Required] Qualifier of the column. Columns in the parent column family that has this exact qualifier are exposed as . field. If the qualifier is valid UTF-8 string, it can be specified in the qualifier_string field. Otherwise, a base-64 encoded value must be set to qualifier_encoded. The column field name is the same as the column qualifier. However, if the qualifier is not a valid BigQuery field identifier i.e. does not match [a-zA-Z][a-zA-Z0-9_]*, a valid identifier must be provided as field_name.", "type": "string"