ve class threshold. For multi-class classfication models this is the confidence threshold." }, "precision": { "type": "number", "format": "double", "description": "Precision is the fraction of actual positive predictions that had positive actual labels. For multiclass this is a macro-averaged metric treating each class as a binary classifier." } }, "type": "object" }, "TimePartitioning": { "id": "TimePartitioning", "properties": { "expirationMs": { "type": "string", "description": "[Optional] Number of milliseconds for which to keep the storage for partitions in the table. The storage in a partition will have an expiration time of its partition time plus this value.", "format": "int64" }, "requirePartitionFilter": { "type": "boolean" }, "type": { "type": "string", "description": "[Required] The supported types are DAY, HOUR, MONTH, and YEAR, which will generate one partition per day, hour, month, and year, respectively. When the type is not specified, the default behavior is DAY." }, "field": { "type": "string", "description": "[Beta] [Optional] If not set, the table is partitioned by pseudo column, referenced via either '_PARTITIONTIME' as TIMESTAMP type, or '_PARTITIONDATE' as DATE type. If field is specified, the table is instead partitioned by this field. The field must be a top-level TIMESTAMP or DATE field. Its mode must be NULLABLE or REQUIRED." } }, "type": "object" }, "ClusterInfo": { "description": "Information about a single cluster for clustering model.", "id": "ClusterInfo", "type": "object", "properties": { "clusterRadius": { "type": "number", "format": "double", "description": "Cluster radius, the average distance from centroid to each point assigned to the cluster." }, "centroidId": { "description": "Centroid id.", "format": "int64", "type": "string" }, "clusterSize": { "description": "Cluster size, the total number of points assigned to the cluster.", "type": "string", "format": "int64" } } }, "AuditConfig": { "id": "AuditConfig", "properties": { "a