" }, "LocationMetadata": { "id": "LocationMetadata", "description": "BigQuery-specific metadata about a location. This will be set on google.cloud.location.Location.metadata in Cloud Location API responses.", "properties": { "legacyLocationId": { "description": "The legacy BigQuery location ID, e.g. “EU” for the “europe” location. This is for any API consumers that need the legacy “US” and “EU” locations.", "type": "string" } }, "type": "object" }, "EncryptionConfiguration": { "id": "EncryptionConfiguration", "type": "object", "properties": { "kmsKeyName": { "type": "string", "description": "[Optional] Describes the Cloud KMS encryption key that will be used to protect destination BigQuery table. The BigQuery Service Account associated with your project requires access to this encryption key." } } }, "TestIamPermissionsResponse": { "id": "TestIamPermissionsResponse", "description": "Response message for `TestIamPermissions` method.", "properties": { "permissions": { "description": "A subset of `TestPermissionsRequest.permissions` that the caller is allowed.", "items": { "type": "string" }, "type": "array" } }, "type": "object" }, "TrainingRun": { "properties": { "results": { "type": "array", "items": { "$ref": "IterationResult" }, "description": "Output of each iteration run, results.size() \u003c= max_iterations." }, "startTime": { "format": "google-datetime", "description": "The start time of this training run.", "type": "string" }, "dataSplitResult": { "description": "Data split result of the training run. Only set when the input data is actually split.", "$ref": "DataSplitResult" }, "modelLevelGlobalExplanation": { "$ref": "GlobalExplanation", "description": "Global explanation contains the explanation of top features on the model level. Applies to both regression and classification models." }, "evaluationMetrics": { "description": "The evaluation metrics over training/eval data that were computed at the end of training.", "$ref": "EvaluationMetrics" }, "classLevelGlobalExplanations": { "description": "Global explanation contains the explanation of top features on the class level. Applies to classification models only.", "type": "array", "items": { "$ref": "GlobalExplanation" } }, "vertexAiModelId": { "type": "string", "description": "The model id in Vertex AI Model Registry for this training run" }, "vertexAiModelVersion": { "description": "The model version in Vertex AI Model Registry for this training run", "type": "string" }, "trainingOptions": { "description": "Options that were used for this training run, includes user specified and default options that were used.", "$ref": "TrainingOptions" } }, "id": "TrainingRun", "type": "object", "description": "Information about a single training query run for the model." }, "ProjectList": { "properties": { "projects": { "type": "array", "items": { "properties": { "id": { "description": "An opaque ID of this project.", "type": "string" }, "numericId": { "format": "uint64", "type": "string", "description": "The numeric ID of this project." }, "friendlyName": { "type": "string", "description": "A descriptive name for this project." }, "kind": { "description": "The resource type.", "type": "string", "default": "bigquery#project" }, "projectReference": { "$ref": "ProjectReference", "description": "A unique reference to this project." } }, "type": "object" }, "description": "Projects to which you have at least READ access." }, "kind": { "type": "string", "default": "bigquery#projectList", "description": "The type of list." }, "nextPageToken": { "type": "string", "description": "A token to request the next page of results." }, "totalItems": { "type": "integer", "format": "int32", "description": "The total number of projects in the list." }, "etag": { "description": "A hash of the page of results", "type": "string" } }, "id": "ProjectList", "type": "object" }, "JobStatistics3": { "type": "object", "id": "JobStatistics3", "properties": { "inputFileBytes": { "format": "int64", "description": "[Output-only] Number of bytes of source data in a load job.", "type": "string" }, "outputRows": { "format": "int64", "type": "string", "description": "[Output-only] Number of rows imported in a load job. Note that while an import job is in the running state, this value may change." }, "outputBytes": { "description": "[Output-only] Size of the loaded data in bytes. Note that while a load job is in the running state, this value may change.", "type": "string", "format": "int64" }, "inputFiles": { "format": "int64", "description": "[Output-only] Number of source files in a load job.", "type": "string" }, "badRecords": { "format": "int64", "type": "string", "description": "[Output-only] The number of bad records encountered. Note that if the job has failed because of more bad records encountered than the maximum allowed in the load job configuration, then this number can be less than the total number of bad records present in the input data." } } }, "JobConfigurationLoad": { "type": "object", "id": "JobConfigurationLoad", "properties": { "allowQuotedNewlines": { "description": "Indicates if BigQuery should allow quoted data sections that contain newline characters in a CSV file. The default value is false.", "type": "boolean" }, "destinationTableProperties": { "description": "[Beta] [Optional] Properties with which to create the destination table if it is new.", "$ref": "DestinationTableProperties" }, "schemaUpdateOptions": { "description": "Allows the schema of the destination table to be updated as a side effect of the load job if a schema is autodetected or supplied in the job configuration. Schema update options are supported in two cases: when writeDisposition is WRITE_APPEND; when writeDisposition is WRITE_TRUNCATE and the destination table is a partition of a table, specified by partition decorators. For normal tables, WRITE_TRUNCATE will always overwrite the schema. One or more of the following values are specified: ALLOW_FIELD_ADDITION: allow adding a nullable field to the schema. ALLOW_FIELD_RELAXATION: allow relaxing a required field in the original schema to nullable.", "items": { "type": "string" }, "type": "array" }, "parquetOptions": { "description": "[Optional] Options to configure parquet support.", "$ref": "ParquetOptions" }, "useAvroLogicalTypes": { "type": "boolean", "description": "[Optional] If sourceFormat is set to \"AVRO\", indicates whether to interpret logical types as the corresponding BigQuery data type (for example, TIMESTAMP), instead of using the raw type (for example, INTEGER)." }, "writeDisposition": { "type": "string", "description": "[Optional] Specifies the action that occurs if the destination table already exists. The following values are supported: WRITE_TRUNCATE: If the table already exists, BigQuery overwrites the table data. WRITE_APPEND: If the table already exists, BigQuery appends the data to the table. WRITE_EMPTY: If the table already exists and contains data, a 'duplicate' error is returned in the job result. The default value is WRITE_APPEND. Each action is atomic and only occurs if BigQuery is able to complete the job successfully. Creation, truncation and append actions occur as one atomic update upon job completion." }, "createDisposition": { "type": "string", "description": "[Optional] Specifies whether the job is allowed to create new tables. The following values are supported: CREATE_IF_NEEDED: If the table does not exist, BigQuery creates the table. CREATE_NEVER: The table must already exist. If it does not, a 'notFound' error is returned in the job result. The default value is CREATE_IF_NEEDED. Creation, truncation and append actions occur as one atomic update upon job completion." }, "schemaInlineFormat": { "description": "[Deprecated] The format of the schemaInline property.", "type": "string" }, "nullMarker": { "type": "string", "description": "[Optional] Specifies a string that represents a null value in a CSV file. For example, if you specify \"\\N\", BigQuery interprets \"\\N\" as a null value when loading a CSV file. The default value is the empty string. If you set this property to a custom value, BigQuery throws an error if an empty string is present for all data types except for STRING and BYTE. For STRING and BYTE columns, BigQuery interprets the empty string as an empty value." }, "allowJaggedRows": { "type": "boolean", "description": "[Optional] Accept rows that are missing trailing optional columns. The missing values are treated as nulls. If false, records with missing trailing columns are treated as bad records, and if there are too many bad records, an invalid error is returned in the job result. The default value is false. Only applicable to CSV, ignored for other formats." }, "rangePartitioning": { "description": "[TrustedTester] Range partitioning specification for this table. Only one of timePartitioning and rangePartitioning should be specified.", "$ref": "RangePartitioning" }, "fieldDelimiter": { "type": "string", "description": "[Optional] The separator for fields in a CSV file. The separator can be any ISO-8859-1 single-byte character. To use a character in the range 128-255, you must encode the character as UTF8. BigQuery converts the string to ISO-8859-1 encoding, and then uses the first byte of the encoded string to split the data in its raw, binary state. BigQuery also supports the escape sequence \"\\t\" to specify a tab separator. The default value is a comma (',')." }, "jsonExtension": { "description": "[Optional] If sourceFormat is set to newline-delimited JSON, indicates whether it should be processed as a JSON variant such as GeoJSON. For a sourceFormat other than JSON, omit this field. If the sourceFormat is newline-delimited JSON: - for newline-delimited GeoJSON: set to GEOJSON.", "type": "string" }, "timePartitioning": { "$ref": "TimePartitioning", "description": "Time-based partitioning specification for the destination table. Only one of timePartitioning and rangePartitioning should be specified." }, "hivePartitioningOptions": { "description": "[Optional] Options to configure hive partitioning support.", "$ref": "HivePartitioningOptions" }, "ignoreUnknownValues": { "type": "boolean", "description": "[Optional] Indicates if BigQuery should allow extra values that are not represented in the table schema. If true, the extra values are ignored. If false, records with extra columns are treated as bad records, and if there are too many bad records, an invalid error is returned in the job result. The default value is false. The sourceFormat property determines what BigQuery treats as an extra value: CSV: Trailing columns JSON: Named values that don't match any column names" }, "quote": { "type": "string", "description": "[Optional] The value that is used to quote data sections in a CSV file. BigQuery converts the string to ISO-8859-1 encoding, and then uses the first byte of the encoded string to split the data in its raw, binary state. The default value is a double-quote ('\"'). If your data does not contain quoted sections, set the property value to an empty string. If your data contains quoted newline characters, you must also set the allowQuotedNewlines property to true.", "default": "\"", "pattern": ".?" }, "preserveAsciiControlCharacters": { "type": "boolean", "description": "[Optional] Preserves the embedded ASCII control characters (the first 32 characters in the ASCII-table, from '\\x00' to '\\x1F') when loading from CSV. Only applicable to CSV, ignored for other formats." }, "sourceFormat": { "type": "string", "description": "[Optional] The format of the data files. For CSV files, specify \"CSV\". For datastore backups, specify \"DATASTORE_BACKUP\". For newline-delimited JSON, specify \"NEWLINE_DELIMITED_JSON\". For Avro, specify \"AVRO\". For parquet, specify \"PARQUET\". For orc, specify \"ORC\". The default value is CSV." }, "destinationTable": { "$ref": "TableReference", "description": "[Required] The destination table to load the data into." }, "encoding": { "description": "[Optional] The character encoding of the data. The supported values are UTF-8 or ISO-8859-1. The default value is UTF-8. BigQuery decodes the data after the raw, binary data has been split using the values of the quote and fieldDelimiter properties.", "type": "string" }, "clustering": { "description": "[Beta] Clustering specification for the destination table. Must be specified with time-based partitioning, data in the table will be first partitioned and subsequently clustered.", "$ref": "Clustering" }, "projectionFields": { "items": { "type": "string" }, "type": "array", "description": "If sourceFormat is set to \"DATASTORE_BACKUP\", indicates which entity properties to load into BigQuery from a Cloud Datastore backup. Property names are case sensitive and must be top-level properties. If no properties are specified, BigQuery loads all properties. If any named property isn't found in the Cloud Datastore backup, an invalid error is returned in the job result." }, "decimalTargetTypes": { "description": "[Optional] Defines the list of possible SQL data types to which the source decimal values are converted. This list and the precision and the scale parameters of the decimal field determine the target type. In the order of NUMERIC, BIGNUMERIC, and STRING, a type is picked if it is in the specified list and if it supports the precision and the scale. STRING supports all precision and scale values. If none of the listed types supports the precision and the scale, the type supporting the widest range in the specified list is picked, and if a value exceeds the supported range when reading the data, an error will be thrown. Example: Suppose the value of this field is [\"NUMERIC\", \"BIGNUMERIC\"]. If (precision,scale) is: (38,9) -\u003e NUMERIC; (39,9) -\u003e BIGNUMERIC (NUMERIC cannot hold 30 integer digits); (38,10) -\u003e BIGNUMERIC (NUMERIC cannot hold 10 fractional digits); (76,38) -\u003e BIGNUMERIC; (77,38) -\u003e BIGNUMERIC (error if value exeeds supported range). This field cannot contain duplicate types. The order of the types in this field is ignored. For example, [\"BIGNUMERIC\", \"NUMERIC\"] is the same as [\"NUMERIC\", \"BIGNUMERIC\"] and NUMERIC always takes precedence over BIGNUMERIC. Defaults to [\"NUMERIC\", \"STRING\"] for ORC and [\"NUMERIC\"] for the other file formats.", "type": "array", "items": { "type": "string" } }, "sourceUris": { "description": "[Required] The fully-qualified URIs that point to your data in Google Cloud. For Google Cloud Storage URIs: Each URI can contain one '*' wildcard character and it must come after the 'bucket' name. Size limits related to load jobs apply to external data sources. For Google Cloud Bigtable URIs: Exactly one URI can be specified and it has be a fully specified and valid HTTPS URL for a Google Cloud Bigtable table. For Google Cloud Datastore backups: Exactly one URI can be specified. Also, the '*' wildcard character is not allowed.", "type": "array", "items": { "type": "string" } }, "schema": { "description": "[Optional] The schema for the destination table. The schema can be omitted if the destination table already exists, or if you're loading data from Google Cloud Datastore.", "$ref": "TableSchema" }, "skipLeadingRows": { "description": "[Optional] The number of rows at the top of a CSV file that BigQuery will skip when loading the data. The default value is 0. This property is useful if you have header rows in the file that should be skipped.", "format": "int32", "type": "integer" }, "schemaInline": { "description": "[Deprecated] The inline schema. For CSV schemas, specify as \"Field1:Type1[,Field2:Type2]*\". For example, \"foo:STRING, bar:INTEGER, baz:FLOAT\".", "type": "string" }, "destinationEncryptionConfiguration": { "description": "Custom encryption configuration (e.g., Cloud KMS keys).", "$ref": "EncryptionConfiguration" }, "autodetect": { "type": "boolean", "description": "[Optional] Indicates if we should automatically infer the options and schema for CSV and JSON sources." }, "maxBadRecords": { "type": "integer", "format": "int32", "description": "[Optional] The maximum number of bad records that BigQuery can ignore when running the job. If the number of bad records exceeds this value, an invalid error is returned in the job result. This is only valid for CSV and JSON. The default value is 0, which requires that all records are valid." } } }, "ModelDefinition": { "properties": { "trainingRuns": { "description": "[Output-only, Beta] Information about ml training runs, each training run comprises of multiple iterations and there may be multiple training runs for the model if warm start is used or if a user decides to continue a previously cancelled query.", "items": { "$ref": "BqmlTrainingRun" }, "type": "array" }, "modelOptions": { "type": "object", "description": "[Output-only, Beta] Model options used for the first training run. These options are immutable for subsequent training runs. Default values are used for any options not specified in the input query.", "properties": { "lossType": { "type": "string" }, "modelType": { "type": "string" }, "labels": { "type": "array", "items": { "type": "string" } } } } }, "id": "ModelDefinition", "type": "object" }, "ConnectionProperty": { "type": "object", "id": "ConnectionProperty", "properties": { "value": { "description": "[Required] Value of the connection property.", "type": "string" }, "key": { "description": "[Required] Name of the connection property to set.", "type": "string" } } }, "MaterializedViewDefinition": { "type": "object", "properties": { "enableRefresh": { "description": "[Optional] [TrustedTester] Enable automatic refresh of the materialized view when the base table is updated. The default value is \"true\".", "type": "boolean" }, "refreshIntervalMs": { "type": "string", "format": "int64", "description": "[Optional] [TrustedTester] The maximum frequency at which this materialized view will be refreshed. The default value is \"1800000\" (30 minutes)." }, "maxStaleness": { "type": "string", "format": "byte", "description": "[Optional] Max staleness of data that could be returned when materizlized view is queried (formatted as Google SQL Interval type)." }, "query": { "type": "string", "description": "[Required] A query whose result is persisted." }, "lastRefreshTime": { "format": "int64", "type": "string", "description": "[Output-only] [TrustedTester] The time when this materialized view was last modified, in milliseconds since the epoch." } }, "id": "MaterializedViewDefinition" }, "ConfusionMatrix": { "type": "object", "description": "Confusion matrix for multi-class classification models.", "id": "ConfusionMatrix", "properties": { "rows": { "type": "array", "description": "One row per actual label.", "items": { "$ref": "Row" } }, "confidenceThreshold": { "format": "double", "type": "number", "description": "Confidence threshold used when computing the entries of the confusion matrix." } } }, "QueryRequest": { "id": "QueryRequest", "type": "object", "properties": { "queryParameters": { "items": { "$ref": "QueryParameter" }, "description": "Query parameters for Standard SQL queries.", "type": "array" }, "dryRun": { "type": "boolean", "description": "[Optional] If set to true, BigQuery doesn't run the job. Instead, if the query is valid, BigQuery returns statistics about the job such as how many bytes would be processed. If the query is invalid, an error returns. The default value is false." }, "connectionProperties": { "type": "array", "items": { "$ref": "ConnectionProperty" }, "description": "Connection properties." }, "maximumBytesBilled": { "format": "int64", "description": "[Optional] Limits the bytes billed for this job. Queries that will have bytes billed beyond this limit will fail (without incurring a charge). If unspecified, this will be set to your project default.", "type": "string" }, "preserveNulls": { "type": "boolean", "description": "[Deprecated] This property is deprecated." }, "query": { "type": "string", "annotations": { "required": [ "bigquery.jobs.query" ] }, "description": "[Required] A query string, following the BigQuery query syntax, of the query to execute. Example: \"SELECT count(f1) FROM [myProjectId:myDatasetId.myTableId]\"." }, "useLegacySql": { "default": "true", "description": "Specifies whether to use BigQuery's legacy SQL dialect for this query. The default value is true. If set to false, the query will use BigQuery's standard SQL: https://cloud.google.com/bigquery/sql-reference/ When useLegacySql is set to false, the value of flattenResults is ignored; query will be run as if flattenResults is false.", "type": "boolean" }, "kind": { "default": "bigquery#queryRequest", "type": "string", "description": "The resource type of the request." }, "requestId": { "type": "string", "description": "A unique user provided identifier to ensure idempotent behavior for queries. Note that this is different from the job_id. It has the following properties: 1. It is case-sensitive, limited to up to 36 ASCII characters. A UUID is recommended. 2. Read only queries can ignore this token since they are nullipotent by definition. 3. For the purposes of idempotency ensured by the request_id, a request is considered duplicate of another only if they have the same request_id and are actually duplicates. When determining whether a request is a duplicate of the previous request, all parameters in the request that may affect the behavior are considered. For example, query, connection_properties, query_parameters, use_legacy_sql are parameters that affect the result and are considered when determining whether a request is a duplicate, but properties like timeout_ms don't affect the result and are thus not considered. Dry run query requests are never considered duplicate of another request. 4. When a duplicate mutating query request is detected, it returns: a. the results of the mutation if it completes successfully within the timeout. b. the running operation if it is still in progress at the end of the timeout. 5. Its lifetime is limited to 15 minutes. In other words, if two requests are sent with the same request_id, but more than 15 minutes apart, idempotency is not guaranteed." }, "defaultDataset": { "$ref": "DatasetReference", "description": "[Optional] Specifies the default datasetId and projectId to assume for any unqualified table names in the query. If not set, all table names in the query string must be qualified in the format 'datasetId.tableId'." }, "labels": { "additionalProperties": { "type": "string" }, "type": "object", "description": "The labels associated with this job. You can use these to organize and group your jobs. Label keys and values can be no longer than 63 characters, can only contain lowercase letters, numeric characters, underscores and dashes. International characters are allowed. Label values are optional. Label keys must start with a letter and each label in the list must have a different key." }, "createSession": { "type": "boolean", "description": "If true, creates a new session, where session id will be a server generated random id. If false, runs query with an existing session_id passed in ConnectionProperty, otherwise runs query in non-session mode." }, "maxResults": { "format": "uint32", "description": "[Optional] The maximum number of rows of data to return per page of results. Setting this flag to a small value such as 1000 and then paging through results might improve reliability when the query result set is large. In addition to this limit, responses are also limited to 10 MB. By default, there is no maximum row count, and only the byte limit applies.", "type": "integer" }, "timeoutMs": { "description": "[Optional] How long to wait for the query to complete, in milliseconds, before the request times out and returns. Note that this is only a timeout for the request, not the query. If the query takes longer to run than the timeout value, the call returns without any results and with the 'jobComplete' flag set to false. You can call GetQueryResults() to wait for the query to complete and read the results. The default value is 10000 milliseconds (10 seconds).", "format": "uint32", "type": "integer" }, "parameterMode": { "type": "string", "description": "Standard SQL only. Set to POSITIONAL to use positional (?) query parameters or to NAMED to use named (@myparam) query parameters in this query." }, "location": { "description": "The geographic location where the job should run. See details at https://cloud.google.com/bigquery/docs/locations#specifying_your_location.", "type": "string" }, "useQueryCache": { "default": "true", "type": "boolean", "description": "[Optional] Whether to look for the result in the query cache. The query cache is a best-effort cache that will be flushed whenever tables in the query are modified. The default value is true." } } }, "RoutineReference": { "id": "RoutineReference", "type": "object", "properties": { "projectId": { "description": "[Required] The ID of the project containing this routine.", "type": "string" }, "routineId": { "description": "[Required] The ID of the routine. The ID must contain only letters (a-z, A-Z), numbers (0-9), or underscores (_). The maximum length is 256 characters.", "type": "string" }, "datasetId": { "type": "string", "description": "[Required] The ID of the dataset containing this routine." } } }, "BigQueryModelTraining": { "properties": { "expectedTotalIterations": { "type": "string", "description": "[Output-only, Beta] Expected number of iterations for the create model query job specified as num_iterations in the input query. The actual total number of iterations may be less than this number due to early stop.", "format": "int64" }, "currentIteration": { "type": "integer", "format": "int32", "description": "[Output-only, Beta] Index of current ML training iteration. Updated during create model query job to show job progress." } }, "id": "BigQueryModelTraining", "type": "object" }, "Row": { "id": "Row", "properties": { "entries": { "items": { "$ref": "Entry" }, "description": "Info describing predicted label distribution.", "type": "array" }, "actualLabel": { "type": "string", "description": "The original label of this row." } }, "description": "A single row in the confusion matrix.", "type": "object" }, "DoubleCandidates": { "description": "Discrete candidates of a double hyperparameter.", "type": "object", "id": "DoubleCandidates", "properties": { "candidates": { "items": { "format": "double", "type": "number" }, "type": "array", "description": "Candidates for the double parameter in increasing order." } } }, "CsvOptions": { "id": "CsvOptions", "type": "object", "properties": { "null_marker": { "type": "string", "description": "[Optional] An custom string that will represent a NULL value in CSV import data." }, "fieldDelimiter": { "description": "[Optional] The separator for fields in a CSV file. BigQuery converts the string to ISO-8859-1 encoding, and then uses the first byte of the encoded string to split the data in its raw, binary state. BigQuery also supports the escape sequence \"\\t\" to specify a tab separator. The default value is a comma (',').", "type": "string" }, "quote": { "type": "string", "pattern": ".?", "default": "\"", "description": "[Optional] The value that is used to quote data sections in a CSV file. BigQuery converts the string to ISO-8859-1 encoding, and then uses the first byte of the encoded string to split the data in its raw, binary state. The default value is a double-quote ('\"'). If your data does not contain quoted sections, set the property value to an empty string. If your data contains quoted newline characters, you must also set the allowQuotedNewlines property to true." }, "encoding": { "type": "string", "description": "[Optional] The character encoding of the data. The supported values are UTF-8 or ISO-8859-1. The default value is UTF-8. BigQuery decodes the data after the raw, binary data has been split using the values of the quote and fieldDelimiter properties." }, "allowQuotedNewlines": { "type": "boolean", "description": "[Optional] Indicates if BigQuery should allow quoted data sections that contain newline characters in a CSV file. The default value is false." }, "allowJaggedRows": { "description": "[Optional] Indicates if BigQuery should accept rows that are missing trailing optional columns. If true, BigQuery treats missing trailing columns as null values. If false, records with missing trailing columns are treated as bad records, and if there are too many bad records, an invalid error is returned in the job result. The default value is false.", "type": "boolean" }, "skipLeadingRows": { "description": "[Optional] The number of rows at the top of a CSV file that BigQuery will skip when reading the data. The default value is 0. This property is useful if you have header rows in the file that should be skipped. When autodetect is on, the behavior is the following: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh skipLeadingRows unspecified - Autodetect tries to detect headers in the first row. If they are not detected, the row is read as data. Otherwise data is read starting from the second row. LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh skipLeadingRows is 0 - Instructs autodetect that there are no headers and data should be read starting from the first row. LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh skipLeadingRows = N \u003e 0 - Autodetect skips N-1 rows and tries to detect headers in row N. If headers are not detected, row N is just skipped. Otherwise row N is used to extract column names for the detected schema.", "type": "string", "format": "int64" } } }, "ViewDefinition": { "type": "object", "id": "ViewDefinition", "properties": { "useLegacySql": { "type": "boolean", "description": "Specifies whether to use BigQuery's legacy SQL for this view. The default value is true. If set to false, the view will use BigQuery's standard SQL: https://cloud.google.com/bigquery/sql-reference/ Queries and views that reference this view must use the same flag value." }, "userDefinedFunctionResources": { "type": "array", "items": { "$ref": "UserDefinedFunctionResource" }, "description": "Describes user-defined function resources used in the query." }, "useExplicitColumnNames": { "description": "True if the column names are explicitly specified. For example by using the 'CREATE VIEW v(c1, c2) AS ...' syntax. Can only be set using BigQuery's standard SQL: https://cloud.google.com/bigquery/sql-reference/", "type": "boolean" }, "query": { "description": "[Required] A query that BigQuery executes when the view is referenced.", "type": "string" } } }, "TrainingOptions": { "description": "Options used in model training.", "properties": { "nonSeasonalOrder": { "$ref": "ArimaOrder", "description": "A specification of the non-seasonal part of the ARIMA model: the three components (p, d, q) are the AR order, the degree of differencing, and the MA order." }, "kmeansInitializationColumn": { "type": "string", "description": "The column used to provide the initial centroids for kmeans algorithm when kmeans_initialization_method is CUSTOM." }, "maxTreeDepth": { "description": "Maximum depth of a tree for boosted tree models.", "type": "string", "format": "int64" }, "walsAlpha": { "format": "double", "type": "number", "description": "Hyperparameter for matrix factoration when implicit feedback type is specified." }, "dataFrequency": { "description": "The data frequency of a time series.", "enum": [ "DATA_FREQUENCY_UNSPECIFIED", "AUTO_FREQUENCY", "YEARLY", "QUARTERLY", "MONTHLY", "WEEKLY", "DAILY", "HOURLY", "PER_MINUTE" ], "enumDescriptions": [ "", "Automatically inferred from timestamps.", "Yearly data.", "Quarterly data.", "Monthly data.", "Weekly data.", "Daily data.", "Hourly data.", "Per-minute data." ], "type": "string" }, "userColumn": { "description": "User column specified for matrix factorization models.", "type": "string" }, "learnRate": { "type": "number", "description": "Learning rate in training. Used only for iterative training algorithms.", "format": "double" }, "initialLearnRate": { "description": "Specifies the initial learning rate for the line search learn rate strategy.", "format": "double", "type": "number" }, "labelClassWeights": { "description": "Weights associated with each label class, for rebalancing the training data. Only applicable for classification models.", "additionalProperties": { "type": "number", "format": "double" }, "type": "object" }, "feedbackType": { "enumDescriptions": [ "", "Use weighted-als for implicit feedback problems.", "Use nonweighted-als for explicit feedback problems." ], "description": "Feedback type that specifies which algorithm to run for matrix factorization.", "type": "string", "enum": [ "FEEDBACK_TYPE_UNSPECIFIED", "IMPLICIT", "EXPLICIT" ] }, "enableGlobalExplain": { "type": "boolean", "description": "If true, enable global explanation during training." }, "numClusters": { "description": "Number of clusters for clustering models.", "format": "int64", "type": "string" }, "colsampleBynode": { "format": "double", "description": "Subsample ratio of columns for each node(split) for boosted tree models.", "type": "number" }, "maxParallelTrials": { "description": "Maximum number of trials to run in parallel.", "type": "string", "format": "int64" }, "hparamTuningObjectives": { "description": "The target evaluation metrics to optimize the hyperparameters for.", "type": "array", "items": { "enum": [ "HPARAM_TUNING_OBJECTIVE_UNSPECIFIED", "MEAN_ABSOLUTE_ERROR", "MEAN_SQUARED_ERROR", "MEAN_SQUARED_LOG_ERROR", "MEDIAN_ABSOLUTE_ERROR", "R_SQUARED", "EXPLAINED_VARIANCE", "PRECISION", "RECALL", "ACCURACY", "F1_SCORE", "LOG_LOSS", "ROC_AUC", "DAVIES_BOULDIN_INDEX", "MEAN_AVERAGE_PRECISION", "NORMALIZED_DISCOUNTED_CUMULATIVE_GAIN", "AVERAGE_RANK" ], "type": "string", "enumDescriptions": [ "Unspecified evaluation metric.", "Mean absolute error. mean_absolute_error = AVG(ABS(label - predicted))", "Mean squared error. mean_squared_error = AVG(POW(label - predicted, 2))", "Mean squared log error. mean_squared_log_error = AVG(POW(LN(1 + label) - LN(1 + predicted), 2))", "Mean absolute error. median_absolute_error = APPROX_QUANTILES(absolute_error, 2)[OFFSET(1)]", "R^2 score. This corresponds to r2_score in ML.EVALUATE. r_squared = 1 - SUM(squared_error)/(COUNT(label)*VAR_POP(label))", "Explained variance. explained_variance = 1 - VAR_POP(label_error)/VAR_POP(label)", "Precision is the fraction of actual positive predictions that had positive actual labels. For multiclass this is a macro-averaged metric treating each class as a binary classifier.", "Recall is the fraction of actual positive labels that were given a positive prediction. For multiclass this is a macro-averaged metric.", "Accuracy is the fraction of predictions given the correct label. For multiclass this is a globally micro-averaged metric.", "The F1 score is an average of recall and precision. For multiclass this is a macro-averaged metric.", "Logorithmic Loss. For multiclass this is a macro-averaged metric.", "Area Under an ROC Curve. For multiclass this is a macro-averaged metric.", "Davies-Bouldin Index.", "Mean Average Precision.", "Normalized Discounted Cumulative Gain.", "Average Rank." ] } }, "includeDrift": { "type": "boolean", "description": "Include drift when fitting an ARIMA model." }, "trendSmoothingWindowSize": { "type": "string", "format": "int64", "description": "The smoothing window size for the trend component of the time series." }, "autoArima": { "type": "boolean", "description": "Whether to enable auto ARIMA or not." }, "l2Regularization": { "type": "number", "description": "L2 regularization coefficient.", "format": "double" }, "timeSeriesIdColumn": { "description": "The time series id column that was used during ARIMA model training.", "type": "string" }, "preserveInputStructs": { "type": "boolean", "description": "Whether to preserve the input structs in output feature names. Suppose there is a struct A with field b. When false (default), the output feature name is A_b. When true, the output feature name is A.b." }, "dataSplitEvalFraction": { "type": "number", "format": "double", "description": "The fraction of evaluation data over the whole input data. The rest of data will be used as training data. The format should be double. Accurate to two decimal places. Default value is 0.2." }, "numParallelTree": { "format": "int64", "description": "Number of parallel trees constructed during each iteration for boosted tree models.", "type": "string" }, "warmStart": { "description": "Whether to train a model from the last checkpoint.", "type": "boolean" }, "timeSeriesDataColumn": { "description": "Column to be designated as time series data for ARIMA model.", "type": "string" }, "batchSize": { "type": "string", "format": "int64", "description": "Batch size for dnn models." }, "maxIterations": { "format": "int64", "description": "The maximum number of iterations in training. Used only for iterative training algorithms.", "type": "string" }, "itemColumn": { "description": "Item column specified for matrix factorization models.", "type": "string" }, "cleanSpikesAndDips": { "type": "boolean", "description": "If true, clean spikes and dips in the input time series." }, "timeSeriesIdColumns": { "description": "The time series id columns that were used during ARIMA model training.", "type": "array", "items": { "type": "string" } }, "kmeansInitializationMethod": { "enumDescriptions": [ "Unspecified initialization method.", "Initializes the centroids randomly.", "Initializes the centroids using data specified in kmeans_initialization_column.", "Initializes with kmeans++." ], "enum": [ "KMEANS_INITIALIZATION_METHOD_UNSPECIFIED", "RANDOM", "CUSTOM", "KMEANS_PLUS_PLUS" ], "type": "string", "description": "The method used to initialize the centroids for kmeans algorithm." }, "l1Regularization": { "description": "L1 regularization coefficient.", "type": "number", "format": "double" }, "dartNormalizeType": { "enum": [ "DART_NORMALIZE_TYPE_UNSPECIFIED", "TREE", "FOREST" ], "type": "string", "description": "Type of normalization algorithm for boosted tree models using dart booster.", "enumDescriptions": [ "Unspecified dart normalize type.", "New trees have the same weight of each of dropped trees.", "New trees have the same weight of sum of dropped trees." ] }, "numFactors": { "format": "int64", "type": "string", "description": "Num factors specified for matrix factorization models." }, "modelUri": { "description": "Google Cloud Storage URI from which the model was imported. Only applicable for imported models.", "type": "string" }, "minRelativeProgress": { "type": "number", "format": "double", "description": "When early_stop is true, stops training when accuracy improvement is less than 'min_relative_progress'. Used only for iterative training algorithms." }, "subsample": { "type": "number", "description": "Subsample fraction of the training data to grow tree to prevent overfitting for boosted tree models.", "format": "double" }, "horizon": { "type": "string", "format": "int64", "description": "The number of periods ahead that need to be forecasted." }, "decomposeTimeSeries": { "type": "boolean", "description": "If true, perform decompose time series and save the results." }, "distanceType": { "enum": [ "DISTANCE_TYPE_UNSPECIFIED", "EUCLIDEAN", "COSINE" ], "type": "string", "description": "Distance type for clustering models.", "enumDescriptions": [ "", "Eculidean distance.", "Cosine distance." ] }, "minTimeSeriesLength": { "description": "Set fast trend ARIMA_PLUS model minimum training length. Use in pair with time_series_length_fraction.", "format": "int64", "type": "string" }, "boosterType": { "type": "string", "enum": [ "BOOSTER_TYPE_UNSPECIFIED", "GBTREE", "DART" ], "enumDescriptions": [ "Unspecified booster type.", "Gbtree booster.", "Dart booster." ], "description": "Booster type for boosted tree models." }, "minTreeChildWeight": { "format": "int64", "type": "string", "description": "Minimum sum of instance weight needed in a child for boosted tree models." }, "sampledShapleyNumPaths": { "format": "int64", "description": "Number of paths for the sampled shapley explain method.", "type": "string" }, "autoArimaMaxOrder": { "format": "int64", "description": "The max value of non-seasonal p and q.", "type": "string" }, "inputLabelColumns": { "type": "array", "description": "Name of input label columns in training data.", "items": { "type": "string" } }, "treeMethod": { "description": "Tree construction algorithm for boosted tree models.", "type": "string", "enumDescriptions": [ "Unspecified tree method.", "Use heuristic to choose the fastest method.", "Exact greedy algorithm.", "Approximate greedy algorithm using quantile sketch and gradient histogram.", "Fast histogram optimized approximate greedy algorithm." ], "enum": [ "TREE_METHOD_UNSPECIFIED", "AUTO", "EXACT", "APPROX", "HIST" ] }, "maxTimeSeriesLength": { "format": "int64", "description": "Get truncated length by last n points in time series. Use separately from time_series_length_fraction and min_time_series_length.", "type": "string" }, "colsampleBytree": { "type": "number", "description": "Subsample ratio of columns when constructing each tree for boosted tree models.", "format": "double" }, "colsampleBylevel": { "description": "Subsample ratio of columns for each level for boosted tree models.", "format": "double", "type": "number" }, "dataSplitColumn": { "type": "string", "description": "The column to split data with. This column won't be used as a feature. 1. When data_split_method is CUSTOM, the corresponding column should be boolean. The rows with true value tag are eval data, and the false are training data. 2. When data_split_method is SEQ, the first DATA_SPLIT_EVAL_FRACTION rows (from smallest to largest) in the corresponding column are used as training data, and the rest are eval data. It respects the order in Orderable data types: https://cloud.google.com/bigquery/docs/reference/standard-sql/data-types#data-type-properties" }, "minSplitLoss": { "type": "number", "description": "Minimum split loss for boosted tree models.", "format": "double" }, "earlyStop": { "description": "Whether to stop early when the loss doesn't improve significantly any more (compared to min_relative_progress). Used only for iterative training algorithms.", "type": "boolean" }, "learnRateStrategy": { "enum": [ "LEARN_RATE_STRATEGY_UNSPECIFIED", "LINE_SEARCH", "CONSTANT" ], "type": "string", "description": "The strategy to determine learn rate for the current iteration.", "enumDescriptions": [ "", "Use line search to determine learning rate.", "Use a constant learning rate." ] }, "integratedGradientsNumSteps": { "type": "string", "description": "Number of integral steps for the integrated gradients explain method.", "format": "int64" }, "numTrials": { "type": "string", "description": "Number of trials to run this hyperparameter tuning job.", "format": "int64" }, "timeSeriesLengthFraction": { "type": "number", "format": "double", "description": "Get truncated length by fraction in time series." }, "lossType": { "enumDescriptions": [ "", "Mean squared loss, used for linear regression.", "Mean log loss, used for logistic regression." ], "enum": [ "LOSS_TYPE_UNSPECIFIED", "MEAN_SQUARED_LOSS", "MEAN_LOG_LOSS" ], "type": "string", "description": "Type of loss function used during training run." }, "holidayRegion": { "description": "The geographical region based on which the holidays are considered in time series modeling. If a valid value is specified, then holiday effects modeling is enabled.", "enumDescriptions": [ "Holiday region unspecified.", "Global.", "North America.", "Japan and Asia Pacific: Korea, Greater China, India, Australia, and New Zealand.", "Europe, the Middle East and Africa.", "Latin America and the Caribbean.", "United Arab Emirates", "Argentina", "Austria", "Australia", "Belgium", "Brazil", "Canada", "Switzerland", "Chile", "China", "Colombia", "Czechoslovakia", "Czech Republic", "Germany", "Denmark", "Algeria", "Ecuador", "Estonia", "Egypt", "Spain", "Finland", "France", "Great Britain (United Kingdom)", "Greece", "Hong Kong", "Hungary", "Indonesia", "Ireland", "Israel", "India", "Iran", "Italy", "Japan", "Korea (South)", "Latvia", "Morocco", "Mexico", "Malaysia", "Nigeria", "Netherlands", "Norway", "New Zealand", "Peru", "Philippines", "Pakistan", "Poland", "Portugal", "Romania", "Serbia", "Russian Federation", "Saudi Arabia", "Sweden", "Singapore", "Slovenia", "Slovakia", "Thailand", "Turkey", "Taiwan", "Ukraine", "United States", "Venezuela", "Viet Nam", "South Africa" ], "enum": [ "HOLIDAY_REGION_UNSPECIFIED", "GLOBAL", "NA", "JAPAC", "EMEA", "LAC", "AE", "AR", "AT", "AU", "BE", "BR", "CA", "CH", "CL", "CN", "CO", "CS", "CZ", "DE", "DK", "DZ", "EC", "EE", "EG", "ES", "FI", "FR", "GB", "GR", "HK", "HU", "ID", "IE", "IL", "IN", "IR", "IT", "JP", "KR", "LV", "MA", "MX", "MY", "NG", "NL", "NO", "NZ", "PE", "PH", "PK", "PL", "PT", "RO", "RS", "RU", "SA", "SE", "SG", "SI", "SK", "TH", "TR", "TW", "UA", "US", "VE", "VN", "ZA" ], "type": "string" }, "dropout": { "description": "Dropout probability for dnn models.", "type": "number", "format": "double" }, "optimizationStrategy": { "type": "string", "enum": [ "OPTIMIZATION_STRATEGY_UNSPECIFIED", "BATCH_GRADIENT_DESCENT", "NORMAL_EQUATION" ], "enumDescriptions": [ "", "Uses an iterative batch gradient descent algorithm.", "Uses a normal equation to solve linear regression problem." ], "description": "Optimization strategy for training linear regression models." }, "calculatePValues": { "type": "boolean", "description": "Whether or not p-value test should be computed for this model. Only available for linear and logistic regression models." }, "adjustStepChanges": { "description": "If true, detect step changes and make data adjustment in the input time series.", "type": "boolean" }, "hiddenUnits": { "type": "array", "description": "Hidden units for dnn models.", "items": { "format": "int64", "type": "string" } }, "dataSplitMethod": { "type": "string", "description": "The data split type for training and evaluation, e.g. RANDOM.", "enumDescriptions": [ "", "Splits data randomly.", "Splits data with the user provided tags.", "Splits data sequentially.", "Data split will be skipped.", "Splits data automatically: Uses NO_SPLIT if the data size is small. Otherwise uses RANDOM." ], "enum": [ "DATA_SPLIT_METHOD_UNSPECIFIED", "RANDOM", "CUSTOM", "SEQUENTIAL", "NO_SPLIT", "AUTO_SPLIT" ] }, "timeSeriesTimestampColumn": { "type": "string", "description": "Column to be designated as time series timestamp for ARIMA model." } }, "id": "TrainingOptions", "type": "object" }, "QueryResponse": { "properties": { "totalRows": { "description": "The total number of rows in the complete query result set, which can be more than the number of rows in this single page of results.", "format": "uint64", "type": "string" }, "sessionInfo": { "description": "[Output-only] [Preview] Information of the session if this job is part of one.", "$ref": "SessionInfo" }, "jobReference": { "description": "Reference to the Job that was created to run the query. This field will be present even if the original request timed out, in which case GetQueryResults can be used to read the results once the query has completed. Since this API only returns the first page of results, subsequent pages can be fetched via the same mechanism (GetQueryResults).", "$ref": "JobReference" }, "schema": { "$ref": "TableSchema", "description": "The schema of the results. Present only when the query completes successfully." }, "totalBytesProcessed": { "description": "The total number of bytes processed for this query. If this query was a dry run, this is the number of bytes that would be processed if the query were run.", "format": "int64", "type": "string" }, "errors": { "type": "array", "items": { "$ref": "ErrorProto" }, "description": "[Output-only] The first errors or warnings encountered during the running of the job. The final message includes the number of errors that caused the process to stop. Errors here do not necessarily mean that the job has completed or was unsuccessful." }, "kind": { "type": "string", "default": "bigquery#queryResponse", "description": "The resource type." }, "dmlStats": { "description": "[Output-only] Detailed statistics for DML statements Present only for DML statements INSERT, UPDATE, DELETE or TRUNCATE.", "$ref": "DmlStatistics" }, "cacheHit": { "type": "boolean", "description": "Whether the query result was fetched from the query cache." }, "jobComplete": { "description": "Whether the query has completed or not. If rows or totalRows are present, this will always be true. If this is false, totalRows will not be available.", "type": "boolean" }, "pageToken": { "description": "A token used for paging results.", "type": "string" }, "numDmlAffectedRows": { "description": "[Output-only] The number of rows affected by a DML statement. Present only for DML statements INSERT, UPDATE or DELETE.", "type": "string", "format": "int64" }, "rows": { "description": "An object with as many results as can be contained within the maximum permitted reply size. To get any additional rows, you can call GetQueryResults and specify the jobReference returned above.", "type": "array", "items": { "$ref": "TableRow" } } }, "id": "QueryResponse", "type": "object" }, "ProjectReference": { "properties": { "projectId": { "description": "[Required] ID of the project. Can be either the numeric ID or the assigned ID of the project.", "type": "string" } }, "id": "ProjectReference", "type": "object" }, "UserDefinedFunctionResource": { "id": "UserDefinedFunctionResource", "type": "object", "properties": { "resourceUri": { "description": "[Pick one] A code resource to load from a Google Cloud Storage URI (gs://bucket/path).", "type": "string" }, "inlineCode": { "type": "string", "description": "[Pick one] An inline resource that contains code for a user-defined function (UDF). Providing a inline code resource is equivalent to providing a URI for a file containing the same code." } }, "description": "This is used for defining User Defined Function (UDF) resources only when using legacy SQL. Users of Standard SQL should leverage either DDL (e.g. CREATE [TEMPORARY] FUNCTION ... ) or the Routines API to define UDF resources. For additional information on migrating, see: https://cloud.google.com/bigquery/docs/reference/standard-sql/migrating-from-legacy-sql#differences_in_user-defined_javascript_functions" }, "ModelReference": { "properties": { "modelId": { "type": "string", "description": "[Required] The ID of the model. The ID must contain only letters (a-z, A-Z), numbers (0-9), or underscores (_). The maximum length is 1,024 characters." }, "projectId": { "description": "[Required] The ID of the project containing this model.", "type": "string" }, "datasetId": { "type": "string", "description": "[Required] The ID of the dataset containing this model." } }, "type": "object", "id": "ModelReference" }, "GetPolicyOptions": { "properties": { "requestedPolicyVersion": { "description": "Optional. The maximum policy version that will be used to format the policy. Valid values are 0, 1, and 3. Requests specifying an invalid value will be rejected. Requests for policies with any conditional role bindings must specify version 3. Policies with no conditional role bindings may specify any valid value or leave the field unset. The policy in the response might use the policy version that you specified, or it might use a lower policy version. For example, if you specify version 3, but the policy has no conditional role bindings, the response uses version 1. To learn which resources support conditions in their IAM policies, see the [IAM documentation](https://cloud.google.com/iam/help/conditions/resource-policies).", "format": "int32", "type": "integer" } }, "id": "GetPolicyOptions", "description": "Encapsulates settings provided to GetIamPolicy.", "type": "object" }, "ScriptStatistics": { "type": "object", "properties": { "stackFrames": { "items": { "$ref": "ScriptStackFrame" }, "type": "array", "description": "Stack trace showing the line/column/procedure name of each frame on the stack at the point where the current evaluation happened. The leaf frame is first, the primary script is last. Never empty." }, "evaluationKind": { "description": "[Output-only] Whether this child job was a statement or expression.", "type": "string" } }, "id": "ScriptStatistics" }, "Policy": { "properties": { "version": { "format": "int32", "description": "Specifies the format of the policy. Valid values are `0`, `1`, and `3`. Requests that specify an invalid value are rejected. Any operation that affects conditional role bindings must specify version `3`. This requirement applies to the following operations: LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Getting a policy that includes a conditional role binding LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Adding a conditional role binding to a policy LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Changing a conditional role binding in a policy LICENSE Makefile README.md gsa_key.json lua-resty-gcp-dev-1.rockspec lua-resty-gcp-scm-1.rockspec.original lua-resty-gcp-scm-1.rockspec.template spec src upload.sh Removing any role binding, with or without a condition, from a policy that includes conditions **Important:** If you use IAM Conditions, you must include the `etag` field whenever you call `setIamPolicy`. If you omit this field, then IAM allows you to overwrite a version `3` policy with a version `1` policy, and all of the conditions in the version `3` policy are lost. If a policy does not include any conditions, operations on that policy may specify any valid version or leave the field unset. To learn which resources support conditions in their IAM policies, see the [IAM documentation](https://cloud.google.com/iam/help/conditions/resource-policies).", "type": "integer" }, "bindings": { "items": { "$ref": "Binding" }, "description": "Associates a list of `members`, or principals, with a `role`. Optionally, may specify a `condition` that determines how and when the `bindings` are applied. Each of the `bindings` must contain at least one principal. The `bindings` in a `Policy` can refer to up to 1,500 principals; up to 250 of these principals can be Google groups. Each occurrence of a principal counts towards these limits. For example, if the `bindings` grant 50 different roles to `user:alice@example.com`, and not to any other principal, then you can add another 1,450 principals to the `bindings` in the `Policy`.", "type": "array" }, "auditConfigs": { "description": "Specifies cloud audit logging configuration for this policy.", "items": { "$ref": "AuditConfig" }, "type": "array" }, "etag": { "format": "byte", "type": "string", "description": "`etag` is used for optimistic concurrency control as a way to help prevent simultaneous updates of a policy from overwriting each other. It is strongly suggested that systems make use of the `etag` in the read-modify-write cycle to perform policy updates in order to avoid race conditions: An `etag` is returned in the response to `getIamPolicy`, and systems are expected to put that etag in the request to `setIamPolicy` to ensure that their change will be applied to the same version of the policy. **Important:** If you use IAM Conditions, you must include the `etag` field whenever you call `setIamPolicy`. If you omit this field, then IAM allows you to overwrite a version `3` policy with a version `1` policy, and all of the conditions in the version `3` policy are lost." } }, "id": "Policy", "description": "An Identity and Access Management (IAM) policy, which specifies access controls for Google Cloud resources. A `Policy` is a collection of `bindings`. A `binding` binds one or more `members`, or principals, to a single `role`. Principals can be user accounts, service accounts, Google groups, and domains (such as G Suite). A `role` is a named list of permissions; each `role` can be an IAM predefined role or a user-created custom role. For some types of Google Cloud resources, a `binding` can also specify a `condition`, which is a logical expression that allows access to a resource only if the expression evaluates to `true`. A condition can add constraints based on attributes of the request, the resource, or both. To learn which resources support conditions in their IAM policies, see the [IAM documentation](https://cloud.google.com/iam/help/conditions/resource-policies). **JSON example:** { \"bindings\": [ { \"role\": \"roles/resourcemanager.organizationAdmin\", \"members\": [ \"user:mike@example.com\", \"group:admins@example.com\", \"domain:google.com\", \"serviceAccount:my-project-id@appspot.gserviceaccount.com\" ] }, { \"role\": \"roles/resourcemanager.organizationViewer\", \"members\": [ \"user:eve@example.com\" ], \"condition\": { \"title\": \"expirable access\", \"description\": \"Does not grant access after Sep 2020\", \"expression\": \"request.time \u003c timestamp('2020-10-01T00:00:00.000Z')\", } } ], \"etag\": \"BwWWja0YfJA=\", \"version\": 3 } **YAML example:** bindings: - members: - user:mike@example.com - group:admins@example.com - domain:google.com - serviceAccount:my-project-id@appspot.gserviceaccount.com role: roles/resourcemanager.organizationAdmin - members: - user:eve@example.com role: roles/resourcemanager.organizationViewer condition: title: expirable access description: Does not grant access after Sep 2020 expression: request.time \u003c timestamp('2020-10-01T00:00:00.000Z') etag: BwWWja0YfJA= version: 3 For a description of IAM and its features, see the [IAM documentation](https://cloud.google.com/iam/docs/).", "type": "object" }, "BqmlTrainingRun": { "properties": { "startTime": { "format": "date-time", "type": "string", "description": "[Output-only, Beta] Training run start time in milliseconds since the epoch." }, "trainingOptions": { "description": "[Output-only, Beta] Training options used by this training run. These options are mutable for subsequent training runs. Default values are explicitly stored for options not specified in the input query of the first training run. For subsequent training runs, any option not explicitly specified in the input query will be copied from the previous training run.", "type": "object", "properties": { "warmStart": { "type": "boolean" }, "learnRate": { "type": "number", "format": "double" }, "minRelProgress": { "format": "double", "type": "number" }, "l2Reg": { "type": "number", "format": "double" }, "earlyStop": { "type": "boolean" }, "l1Reg": { "format": "double", "type": "number" }, "lineSearchInitLearnRate": { "format": "double", "type": "number" }, "learnRateStrategy": { "type": "string" }, "maxIteration": { "type": "string", "format": "int64" } } }, "state": { "type": "string", "description": "[Output-only, Beta] Different state applicable for a training run. IN PROGRESS: Training run is in progress. FAILED: Training run ended due to a non-retryable failure. SUCCEEDED: Training run successfully completed. CANCELLED: Training run cancelled by the user." }, "iterationResults": { "type": "array", "description": "[Output-only, Beta] List of each iteration results.", "items": { "$ref": "BqmlIterationResult" } } }, "type": "object", "id": "BqmlTrainingRun" }, "QueryParameterValue": { "id": "QueryParameterValue", "type": "object", "properties": { "structValues": { "additionalProperties": { "$ref": "QueryParameterValue" }, "type": "object", "description": "[Optional] The struct field values, in order of the struct type's declaration." }, "value": { "type": "string", "description": "[Optional] The value of this value, if a simple scalar type." }, "arrayValues": { "type": "array", "description": "[Optional] The array values, if this is an array type.", "items": { "$ref": "QueryParameterValue" } } } }, "FeatureValue": { "description": "Representative value of a single feature within the cluster.", "id": "FeatureValue", "type": "object", "properties": { "categoricalValue": { "$ref": "CategoricalValue", "description": "The categorical feature value." }, "featureColumn": { "description": "The feature column name.", "type": "string" }, "numericalValue": { "format": "double", "type": "number", "description": "The numerical feature value. This is the centroid value for this feature." } } }, "BiEngineStatistics": { "properties": { "biEngineMode": { "default": "$(stats.bi_engine_mode)", "description": "[Output-only] Specifies which mode of BI Engine acceleration was performed (if any).", "type": "string" }, "biEngineReasons": { "items": { "$ref": "BiEngineReason" }, "type": "array", "description": "In case of DISABLED or PARTIAL bi_engine_mode, these contain the explanatory reasons as to why BI Engine could not accelerate. In case the full query was accelerated, this field is not populated." } }, "type": "object", "id": "BiEngineStatistics" }, "Job": { "id": "Job", "properties": { "selfLink": { "description": "[Output-only] A URL that can be used to access this resource again.", "type": "string" }, "kind": { "default": "bigquery#job", "description": "[Output-only] The type of the resource.", "type": "string" }, "id": { "description": "[Output-only] Opaque ID field of the job", "type": "string" }, "etag": { "type": "string", "description": "[Output-only] A hash of this resource." }, "configuration": { "description": "[Required] Describes the job configuration.", "$ref": "JobConfiguration" }, "statistics": { "$ref": "JobStatistics", "description": "[Output-only] Information about the job, including starting time and ending time of the job." }, "status": { "$ref": "JobStatus", "description": "[Output-only] The status of this job. Examine this value when polling an asynchronous job to see if the job is complete." }, "user_email": { "description": "[Output-only] Email address of the user who ran the job.", "type": "string" }, "jobReference": { "description": "[Optional] Reference describing the unique-per-user name of the job.", "$ref": "JobReference" } }, "type": "object" }, "IntCandidates": { "properties": { "candidates": { "type": "array", "description": "Candidates for the int parameter in increasing order.", "items": { "format": "int64", "type": "string" } } }, "description": "Discrete candidates of an int hyperparameter.", "id": "IntCandidates", "type": "object" }, "IntArrayHparamSearchSpace": { "properties": { "candidates": { "items": { "$ref": "IntArray" }, "description": "Candidates for the int array parameter.", "type": "array" } }, "type": "object", "description": "Search space for int array.", "id": "IntArrayHparamSearchSpace" }, "ArimaFittingMetrics": { "description": "ARIMA model fitting metrics.", "id": "ArimaFittingMetrics", "properties": { "aic": { "description": "AIC.", "type": "number", "format": "double" }, "logLikelihood": { "description": "Log-likelihood.", "format": "double", "type": "number" }, "variance": { "format": "double", "type": "number", "description": "Variance." } }, "type": "object" }, "IntArray": { "properties": { "elements": { "type": "array", "description": "Elements in the int array.", "items": { "type": "string", "format": "int64" } } }, "type": "object", "id": "IntArray", "description": "An array of int." }, "ArimaModelInfo": { "id": "ArimaModelInfo", "properties": { "arimaCoefficients": { "$ref": "ArimaCoefficients", "description": "Arima coefficients." }, "hasDrift": { "type": "boolean", "description": "Whether Arima model fitted with drift or not. It is always false when d is not 1." }, "arimaFittingMetrics": { "description": "Arima fitting metrics.", "$ref": "ArimaFittingMetrics" }, "nonSeasonalOrder": { "$ref": "ArimaOrder", "description": "Non-seasonal order." }, "hasStepChanges": { "type": "boolean", "description": "If true, step_changes is a part of time series decomposition result." }, "hasHolidayEffect": { "description": "If true, holiday_effect is a part of time series decomposition result.", "type": "boolean" }, "seasonalPeriods": { "type": "array", "items": { "enumDescriptions": [ "Unspecified seasonal period.", "No seasonality", "Daily period, 24 hours.", "Weekly period, 7 days.", "Monthly period, 30 days or irregular.", "Quarterly period, 90 days or irregular.", "Yearly period, 365 days or irregular." ], "type": "string", "enum": [ "SEASONAL_PERIOD_TYPE_UNSPECIFIED", "NO_SEASONALITY", "DAILY", "WEEKLY", "MONTHLY", "QUARTERLY", "YEARLY" ] }, "description": "Seasonal periods. Repeated because multiple periods are supported for one time series." }, "timeSeriesIds": { "items": { "type": "string" }, "description": "The tuple of time_series_ids identifying this time series. It will be one of the unique tuples of values present in the time_series_id_columns specified during ARIMA model training. Only present when time_series_id_columns training option was used and the order of values here are same as the order of time_series_id_columns.", "type": "array" }, "hasSpikesAndDips": { "description": "If true, spikes_and_dips is a part of time series decomposition result.", "type": "boolean" }, "timeSeriesId": { "type": "string", "description": "The time_series_id value for this time series. It will be one of the unique values from the time_series_id_column specified during ARIMA model training. Only present when time_series_id_column training option was used." } }, "type": "object", "description": "Arima model information." }, "CategoryCount": { "id": "CategoryCount", "type": "object", "properties": { "count": { "description": "The count of training samples matching the category within the cluster.", "format": "int64", "type": "string" }, "category": { "description": "The name of category.", "type": "string" } }, "description": "Represents the count of a single category within the cluster." }, "Table": { "type": "object", "id": "Table", "properties": { "type": { "description": "[Output-only] Describes the table type. The following values are supported: TABLE: A normal BigQuery table. VIEW: A virtual table defined by a SQL query. SNAPSHOT: An immutable, read-only table that is a copy of another table. [TrustedTester] MATERIALIZED_VIEW: SQL query whose result is persisted. EXTERNAL: A table that references data stored in an external storage system, such as Google Cloud Storage. The default value is TABLE.", "type": "string" }, "selfLink": { "description": "[Output-only] A URL that can be used to access this resource again.", "type": "string" }, "etag": { "description": "[Output-only] A hash of the table metadata. Used to ensure there were no concurrent modifications to the resource when attempting an update. Not guaranteed to change when the table contents or the fields numRows, numBytes, numLongTermBytes or lastModifiedTime change.", "type": "string" }, "externalDataConfiguration": { "$ref": "ExternalDataConfiguration", "description": "[Optional] Describes the data format, location, and other properties of a table stored outside of BigQuery. By defining these properties, the data source can then be queried as if it were a standard BigQuery table." }, "kind": { "description": "[Output-only] The type of the resource.", "default": "bigquery#table", "type": "string" }, "materializedView": { "$ref": "MaterializedViewDefinition", "description": "[Optional] Materialized view definition." }, "rangePartitioning": { "$ref": "RangePartitioning", "description": "[TrustedTester] Range partitioning specification for this table. Only one of timePartitioning and rangePartitioning should be specified." }, "defaultCollation": { "description": "[Output-only] The default collation of the table.", "type": "string" }, "expirationTime": { "description": "[Optional] The time when this table expires, in milliseconds since the epoch. If not present, the table will persist indefinitely. Expired tables will be deleted and their storage reclaimed. The defaultTableExpirationMs property of the encapsulating dataset can be used to set a default expirationTime on newly created tables.", "format": "int64", "type": "string" }, "num_active_logical_bytes": { "description": "[Output-only] Number of logical bytes that are less than 90 days old.", "type": "string", "format": "int64" }, "num_total_logical_bytes": { "type": "string", "format": "int64", "description": "[Output-only] Total number of logical bytes in the table or materialized view." }, "num_total_physical_bytes": { "format": "int64", "type": "string", "description": "[Output-only] The physical size of this table in bytes. This also includes storage used for time travel. This data is not kept in real time, and might be delayed by a few seconds to a few minutes." }, "numRows": { "format": "uint64", "description": "[Output-only] The number of rows of data in this table, excluding any data in the streaming buffer.", "type": "string" }, "num_long_term_logical_bytes": { "format": "int64", "description": "[Output-only] Number of logical bytes that are more than 90 days old.", "type": "string" }, "labels": { "additionalProperties": { "type": "string" }, "description": "The labels associated with this table. You can use these to organize and group your tables. Label keys and values can be no longer than 63 characters, can only contain lowercase letters, numeric characters, underscores and dashes. International characters are allowed. Label values are optional. Label keys must start with a letter and each label in the list must have a different key.", "type": "object" }, "friendlyName": { "type": "string", "description": "[Optional] A descriptive name for this table." }, "schema": { "$ref": "TableSchema", "description": "[Optional] Describes the schema of this table." }, "location": { "type": "string", "description": "[Output-only] The geographic location where the table resides. This value is inherited from the dataset." }, "clustering": { "description": "[Beta] Clustering specification for the table. Must be specified with partitioning, data in the table will be first partitioned and subsequently clustered.", "$ref": "Clustering" }, "description": { "type": "string", "description": "[Optional] A user-friendly description of this table." }, "creationTime": { "description": "[Output-only] The time when this table was created, in milliseconds since the epoch.", "type": "string", "format": "int64" }, "streamingBuffer": { "description": "[Output-only] Contains information regarding this table's streaming buffer, if one is present. This field will be absent if the table is not being streamed to or if there is no data in the streaming buffer.", "$ref": "Streamingbuffer" }, "timePartitioning": { "$ref": "TimePartitioning", "description": "Time-based partitioning specification for this table. Only one of timePartitioning and rangePartitioning should be specified." }, "id": { "description": "[Output-only] An opaque ID uniquely identifying the table.", "type": "string" }, "requirePartitionFilter": { "description": "[Optional] If set to true, queries over this table require a partition filter that can be used for partition elimination to be specified.", "default": "false", "type": "boolean" }, "view": { "description": "[Optional] The view definition.", "$ref": "ViewDefinition" }, "tableReference": { "$ref": "TableReference", "description": "[Required] Reference describing the ID of this table." }, "numPhysicalBytes": { "type": "string", "description": "[Output-only] [TrustedTester] The physical size of this table in bytes, excluding any data in the streaming buffer. This includes compression and storage used for time travel.", "format": "int64" }, "numBytes": { "type": "string", "description": "[Output-only] The size of this table in bytes, excluding any data in the streaming buffer.", "format": "int64" }, "maxStaleness": { "format": "byte", "description": "[Optional] Max staleness of data that could be returned when table or materialized view is queried (formatted as Google SQL Interval type).", "type": "string" }, "model": { "description": "[Output-only, Beta] Present iff this table represents a ML model. Describes the training information for the model, and it is required to run 'PREDICT' queries.", "$ref": "ModelDefinition" }, "cloneDefinition": { "$ref": "CloneDefinition", "description": "[Output-only] Clone definition." }, "num_active_physical_bytes": { "format": "int64", "description": "[Output-only] Number of physical bytes less than 90 days old. This data is not kept in real time, and might be delayed by a few seconds to a few minutes.", "type": "string" }, "num_long_term_physical_bytes": { "format": "int64", "type": "string", "description": "[Output-only] Number of physical bytes more than 90 days old. This data is not kept in real time, and might be delayed by a few seconds to a few minutes." }, "num_partitions": { "type": "string", "format": "int64", "description": "[Output-only] The number of partitions present in the table or materialized view. This data is not kept in real time, and might be delayed by a few seconds to a few minutes." }, "snapshotDefinition": { "description": "[Output-only] Snapshot definition.", "$ref": 