g time and ending time of the job.", "$ref": "JobStatistics" }, "state": { "type": "string", "description": "Running state of the job. When the state is DONE, errorResult can be checked to determine whether the job succeeded or failed." }, "status": { "description": "[Full-projection-only] Describes the state of the job.", "$ref": "JobStatus" }, "id": { "description": "Unique opaque ID of the job.", "type": "string" }, "errorResult": { "$ref": "ErrorProto", "description": "A result object that will be present only if the job has failed." }, "user_email": { "description": "[Full-projection-only] Email address of the user who ran the job.", "type": "string" } }, "type": "object" } } }, "id": "JobList", "type": "object" }, "HivePartitioningOptions": { "type": "object", "properties": { "requirePartitionFilter": { "description": "[Optional] If set to true, queries over this table require a partition filter that can be used for partition elimination to be specified. Note that this field should only be true when creating a permanent external table or querying a temporary external table. Hive-partitioned loads with requirePartitionFilter explicitly set to true will fail.", "type": "boolean" }, "mode": { "description": "[Optional] When set, what mode of hive partitioning to use when reading data. The following modes are supported. (1) AUTO: automatically infer partition key name(s) and type(s). (2) STRINGS: automatically infer partition key name(s). All types are interpreted as strings. (3) CUSTOM: partition key schema is encoded in the source URI prefix. Not all storage formats support hive partitioning. Requesting hive partitioning on an unsupported format will lead to an error. Currently supported types include: AVRO, CSV, JSON, ORC and Parquet.", "type": "string" }, "sourceUriPrefix": { "type": "string", "description": "[Optional] When hive partition detection is requested, a common prefix for all source uris should be supplied. The prefix must end immediately before the